import React from 'react'
let style = {
    display : 'flex',
    justifyContent : 'center',
    alignItems: 'center'
    // padding : '20px',
    // margin : '5px',
    // textAlign : 'center',
    // width : '100vw'
}
let inputStyle = {
  margin : '10px',
  padding : '5px',
  borderRadius : '10px'
}
function Form() {
  return (
    <div style={style}>
      <input style={inputStyle} type="text" name="frst Name" />
      <input style={inputStyle} type="text" name="2nd Name" />
      <input style={inputStyle} type="email" name="email"/>
    </div>
  )
}

export default Form
